import axios from "axios";

export const asyncGetRoom = () => {
    return (dispatch) => {
        axios.get('http://localhost:3088/api/room')
            .then((response) => {
                const data = response.data
                console.log(data)
            })
            .catch((err) => {
                console.log(err)
            })
    }
}
